import React from "react";
import { useEffect,useState } from "react";
import { useHistory } from "react-router-dom";
import NavigationIcon from '@mui/icons-material/Navigation';
import Fab from '@mui/material/Fab';

import { useSelector } from "react-redux";
import { instance } from "../../axios/axiosInstance";
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

const Rank = () => {
  var score = useSelector((state) => state.score);
  const [rank,setRank]=useState(0)
  const history = useHistory();

  function getRank() {
    instance.post("rank", { finalScore: score }).then((res) => {
      console.log(res.data.rank);
      setRank(res.data.rank)
    });
  }
  useEffect(() => {
    getRank();
  }, []);
  const handleNavigation=()=>{

    history.push("/");
  }
  return (
    <Card variant="outlined" sx={{ minWidth: 275 ,maxWidth:500,padding:5,margin:"auto"}} >
      <CardContent>
      
        <Typography variant="h3" sx={{ mb: 1.5 }} color="#0d6efd">
          Your Score Is {rank}
       
        </Typography>
      </CardContent>
      <CardActions>
      <Fab onClick={()=>handleNavigation()} variant="extended" color="primary">
        <NavigationIcon sx={{ mr: 1 }} />
        Play Again
      </Fab>
      </CardActions>
    </Card>
  );
};

export default Rank;
